import vtkCutter from './Core/Cutter.js';
import vtkPolyDataNormals from './Core/PolyDataNormals.js';

var Core = {
  vtkCutter: vtkCutter,
  vtkPolyDataNormals: vtkPolyDataNormals
};

export { Core as default };
